import React from "react";

const Tab = () => {
  return (
    <div>
      <div className="flex text-white">
        <button className="flex-1 flex flex-col justify-center items-center outline-none border-solid border-4 border-gray-600">
          <i class="fas fa-tv fa-2x"></i>
          <span>TV</span>
        </button>
        <button className="flex-1 flex flex-col justify-center items-center outline-none border-none">
          <i class="fas fa-mobile-alt fa-2x"></i>
          <span>Phone, Tablet &amp; Mobile</span>
        </button>
        <button className="flex-1 flex flex-col justify-center items-center outline-none">
          <i class="fas fa-laptop fa-2x"></i>
          <span>Desktop &amp; Laptop</span>
        </button>
      </div>
      <div>TV Content</div>
      <div>Phone, Tablet Content</div>
      <div>Desktop Laptop Content</div>
    </div>
  );
};

export default Tab;
